import React, { useState } from 'react';
import FileStructure from './FileStructure';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import 'bootstrap/dist/css/bootstrap.min.css';
import { faCheckCircle, faCog, faList, faFileAlt, faChartBar } from '@fortawesome/free-solid-svg-icons';


function HomePage() {
    const [showDiv, setShowDiv] = useState(false);

    // const iconImage = ['s1.jpeg', 's2.jpeg', 's3.jpeg']; 

    const palleteIconClasses = ['glyphicon glyphicon-plus', 'glyphicon glyphicon-plus', 'glyphicon glyphicon-plus'];

    const palatteIcon = (srcName) => {
        return(
            <div className='palatte-icon'>
                <a href="#">
                    <span class={srcName}></span>
                </a>
                <img class={srcName} src={srcName}></img>
                <hr/>
            </div>
        );
    }

    const divStyle = {
        display: showDiv ? 'block' : 'none',
        backgroundColor: '#f0f0f0',
        padding: '20px',
        marginTop: '20px',
    };

    return (
        <>
            <div>
                <p className="top-text">Job</p>
                <div className="parent">
                    <div className="palatte-area">
                    <FileStructure />
                    </div>
                    <div className='content-area'>
                        <div className='icons'>
                            {
                                palleteIconClasses.map((src) => palatteIcon(src))
                            }
                        </div>
                        <div className='task'>
                            <button>Status</button>
                            <button>Setup</button>
                            <button>Namelists</button>
                            <button>Output</button>
                            <button>Plots</button>
                        </div>
                    </div>
                </div>
            </div>

        </>  
    );
}

export default HomePage;
